import React, { useEffect, useState } from "react";
import Articles from "./components/Articles/Articles";
import Navbar from "./components/Navbar/Navbar";
import Quote from "./components/Quote/Quote";

function App() {
  const [fetchedAOLArticles, setFetchedAOLArticles] = useState([]);

  useEffect(() => {
    if (fetchedAOLArticles.length === 0) {
      fetchAOLArticles();
    }
  }, [fetchedAOLArticles.length]);

  function fetchAOLArticles() {
    console.log("Fetching articles");
    fetch("/api/artOfHealthyLivingScrape")
      .then((res) => res.json())
      .then((articles) =>
        setFetchedAOLArticles((prevArticles) => [...prevArticles, articles])
      );
  }

  return (
    <div className="App">
      <Navbar />
      <Quote />
      <Articles artcles={fetchedAOLArticles} />
    </div>
  );
}

export default App;
